import React from 'react';
import './ContactUs.css';

const ContactUs = () => {
  return (
    <div className="contact-container">
      <h2>Contact Us</h2>
      <div className="contact-info">
        <div className="contact-item email">
          <h3>Email Us</h3>
          <p><a href="mailto:info@adventuretalesworld.com">rathoresachin2023@gmail.com</a></p>
        </div>

        <div className="contact-item whatsapp">
          <h3>WhatsApp Us</h3>
          <p><a href="https://wa.me/123456789">+995 598 28 38 10</a></p>
        </div>

        <div className="contact-item phone">
          <h3>Call Us</h3>
          <p><a href="tel:+123456789">+995 598 28 38 10</a></p>
        </div>

        <div className="contact-item address">
          <h3>Our Address</h3>
          <p>Tbilisi, Georgia</p>
          <p>Dubai, UAE</p>
        </div>
      </div>
    </div>
  );
};

export default ContactUs;
